css:
@-moz-document domain("translate.google.com") {
body {
    height: auto;
    color: #a6a6a6;
    background-color: #000;
    background-image: url(data:image/png;base64,) !important;
}
#gt-appbar,
#gt-text-c,
#gt-apb-main,
.gt-hl-layer,
.gb_ve,
#gt-ft-res,
.gb_we {
    background: none;
}

.gt-card-ttl-txt, .goog-menuitem {
    color: #a6a6a6;
}

.gt-ex-text {
	color: #777;
}

#source,
#result_box,
.gt-baf-word-clickable {
    color: #a6a6a6;
}

.gt-related-suggest-message,
.gt-revert-correct-message,
#gt-feedback,
#gt-otf-switch {
     color: #a6a6a6 !important;
}

.gt-def-example
.copy-button .jfk-button-img,
.trans-listen-button .jfk-button-img,
.share-button .jfk-button-img,
.trans-edit-button .jfk-button-img,
.clear-button .jfk-button-img,
.ita-kd-img,
.trans-roman-button .jfk-button-img,
.copy-button .jfk-button-img,
.speech-button .jfk-button-img, #gb#gb a.gb_Wb, .trans-swap-button .jfk-button-img {
    -webkit-filter: invert(100%) !important;
}
#gt-res-wrap, .gt-is,.goog-menu {
    background: #242424;
}
.gt-is-itm-hover {
    background-color: #484848;
}
.ita-kd-inputtools-div {
    background-color: transparent !important;
}
.gt-hl-layer {
    border: none;
}
.gb_uc {
    background-color: #6d6d6d;
}

.jfk-button-standard, .goog-flat-menu-button {
    background-image: -webkit-linear-gradient(top,#505050,#2b2b2b);
    color: #a6a6a6;
    border-color: #5a5a5a;
}
.jfk-button-standard.jfk-button-hover, .jfk-button-standard.jfk-button-clear-outline.jfk-button-hover {
	background-image: -webkit-linear-gradient(top,#505050,#2b2b2b);
    color: #a6a6a6;
    cursor: pointer;
}
.jfk-button-standard.jfk-button-checked, .jfk-button-standard.jfk-button-clear-outline.jfk-button-checked {
    background-image: -webkit-linear-gradient(top,#737373,#e03636);
    border: 1px solid #d8d8d8;
    color: #eae9e9;
}
.jfk-button-standard.jfk-button-disabled {
    background: #383838;
}
.jfk-button-standard.jfk-button-clear-outline, .jfk-button-standard {
    border-color: #5a5a5a;
}
}
